import React from 'react';

function Content(props) {
  // const [open, setOpen] = useState(false);



  return(
      <div id="content-box">

        <div id="title-box">
          <h1>BOYAN LEVCHEV</h1>
          <h2>FULL STACK WEB DEVELOPER</h2>
          <h2>LINKEDIN:<a href="https://linkedin.com/in/boyanlevchev">linkedin.com/in/boyanlevchev</a></h2>
          <h2>GITHUB:<a href="https://github.com/boyanlevchev">github.com/boyanlevchev</a></h2>
        </div>

        <div id="links-box">

          <ul id="links">
            <li id="muse-li"><h2>> Muse VR</h2><h2>A DIY virtual reality gallery builder for artists and curators</h2></li>
            <li id="froala-li"><h2>> Froala Whiteboard</h2><h2>A collaborative brainstorming tool</h2></li>
            <li id="violeta-li"><h2>> Violeta Popov M.D.</h2><h2>A portfolio website for a NY-based medical practitioner</h2></li>
            <div className="muse-1 muse-images"></div>
            <div className="muse-2 muse-images"></div>
            <img className="violeta-image" src="violeta.jpg"/>
          </ul>
        </div>

      </div>
    )
}

export default Content;
